import React from "react";
import { BrowserRouter, Route } from "react-router-dom";

import Navbar from "./Navbar";
import TweetList from "./TweetList";
import CurrentTweets from "./CurrentTweets";
import AnnotationTweets from "./AnnotationTweets";

class App extends React.Component {
  render() {
    return (
      <div className="ui container">
        <BrowserRouter>
          <Navbar />
          <Route exact path="/jobs?sort=recent" component={TweetList} />
          <Route exact path="/jobs?sort=current" component={CurrentTweets} />
          <Route
            exact
            path="/jobs?sort=annotations"
            component={AnnotationTweets}
          />
        </BrowserRouter>
        >
      </div>
    );
  }
}

export default App;
